import React from 'react';

import { ListGroup } from 'react-bootstrap';

class ListsView extends React.Component {
    constructor() {
        super();

        this.state = {
            lists: [
                {
                    name: "Placeholder #1",
                    id: "1"
                },
                {
                    name: "Placeholder #2",
                    id: "2"
                }
            ]
        }
    }


    render() {
        return(
            <ListGroup>
                {
                    this.state.lists.map((list, idx) =>
                        <ListGroup.Item>
                            <Link to={`list/${list.id}`}> {list.name} </Link>
                        </ListGroup.Item>
                    )
                }
            </ListGroup>
        )
    }
}

export default ListsView;
